import React from 'react';
import './Github.css';

const Card = () => {
  return (
    <div className="card">
      <h3>My GitHub</h3>
      <p>Visit my GitHub profile for some nicer projects =D</p>
      <a href="https://github.com/GioDoesntKnowCode" target="_blank" rel="noopener noreferrer">
        Go to GitHub
      </a>
    </div>
  );
};

export default Card;
